import { Text } from "react-native";

export default function Saludar() {
  return (
    <View style={styles.container}>
      <View>
        <Text>Ingresa estos datos para iniciar</Text>
        <Text style={styles.olvidasteContras}>¿Olvidaste tu contraseña?</Text>
      </View>
    </View>
  );
}
